    <style>
      .judge-ring-big {
        content: '';
        position: absolute;
        top: -32.5px;
        left: -32.5px;
        width: 65px;
        height: 65px;
        border: 2px solid #aaaaaa;
        border-radius: 50%;
        display: grid;
        z-index: -9999;
      }

      .judge-ring-center {
        position: absolute;
        top: 40px;
        left: calc(44px + 22px);
        z-index: -9999;
      }

      .judge-ring-small {
        content: '';
        position: absolute;
        top: -25px;
        left: -25px;
        width: 50px;
        height: 50px;
        border: 2px solid #aaaaaa;
        border-radius: 50%;
        display: grid;
        z-index: -9999;
      }     

      .judge-ring-small::before {
        content: '';
        width: 84%;
        height: 84%;
        justify-content: center;
        align-items: center;
        border-radius: 50%;
        background-color: #aaaaaa;
        margin: auto;
        z-index: -9999;
      }

      .note {
        background-color: white;
        border: 2.5px solid black;
        border-radius: 50%;
        display: grid;
      }

      .small-note {
        width: 50px;
        height: 50px;
      }

      .small-note-wrapper {
        position: absolute;
        top: -25px;
        left: -25px;
      }

      .big-note {
        width: 65px;
        height: 65px;
      }

      .big-note-wrapper {
        position: absolute;
        top: -32.5px;
        left: -32.5px;
      }
      
      .note-inner {
        align-items: center;
        justify-content: center;
        margin: auto;
        width: 84%;
        height: 84%;
        border-radius: 50%;
      }

      .ka {
        background-color: #72d7d8;
      }

      .don {
        background-color: #eb5038;
      }

      .balloon {
        background-color: #ed781b;
      }

      .renda {
        background-color: #fdb800;
      }

      .renda-tail {
        height: 50px;
        left: 25px;
        border-top-right-radius: 25px;
        border-bottom-right-radius: 25px;
        background-color: #fdb800;
        border: 2.5px solid black;
        border-left: 0;
        z-index: -100;
        position: absolute;
      }

            // Going backwards: from bytestream, to percent-encoding, to original string.

      function KaNote({ centerx = 0, centery = "50%", combo = ''}) {

          position: 'absolute',
          top: centery,
          left: centerx

            <div className="note-inner ka">{combo}</div>
          </div>
        </div>
      }

      function BigKaNote({ centerx = 0, centery = "50%", combo = ''}) {
        return <div style={{
          position: 'absolute',
          top: centery,
          left: centerx
        }}>
          <div className="note big-note big-note-wrapper"> 
            <div className="note-inner ka">{combo}</div>
          </div>
        </div>
      }
      
      function DonNote({ centerx = 0, centery = "50%", combo = ''}) {
        return <div style={{
          position: 'absolute',
          top: centery,
          left: centerx
        }}>
          <div className="note small-note small-note-wrapper"> 
            <div className="note-inner don">{combo}</div>
          </div>
        </div>
      }

      function BigDonNote({ centerx = 0, centery = "50%", combo = ''}) {
        return <div style={{
          position: 'absolute',
          top: centery,
          left: centerx
        }}>
          <div className="note big-note big-note-wrapper"> 
            <div className="note-inner don">{combo}</div>
          </div>
        </div>
      }

      function RendaNote({ length = 50, centerx = 0, centery = "50%"}) {
        // var width = "calc(" + Math.round(length) + " + 22px)";
        return <div style={{
          position: 'absolute',
          top: centery,
          left: centerx
        }}>
            <div className="small-note-wrapper relative">
              <div className="small-note note float-left"> 
                <div className="note-inner renda"></div>
              </div>
              <div className="renda-tail renda float-left" style={{width: (length + 22) + "px"}}></div>
            </div>
          </div>
      }

      function BalloonNote({ centerx = 0, centery = "50%" }) {
        return <div style={{
          position: 'absolute',
          top: centery,
          left: centerx
        }}>
          <div className="small-note note small-note-wrapper"> 
            <div className="note-inner balloon"></div>
          </div>
        </div>
      }

      function Barline({ centerx = 0, centery = "50%" }) {
        return <div style={{
          position: 'absolute',
          top: centery,
          left: centerx
        }}>
          <div style={{
            position: 'absolute',
            top: '-40px',
            left: '-1px',
            width: '2px',
            height: "80px",
            backgroundColor: '#aaaaaa',
            zIndex: '-9998'
          }}></div>
        </div>
      }

      function Playfield({tja, startFrameTime = -1}) {

        // console.log("hi", startFrameTime)

        let [frameTime, setFrameTime] = React.useState(-2);

        React.useEffect(() => {
          let animationFrameId;

          const updateFrameTime = (curTime) => {
            setFrameTime(() => {
              // console.log("inside", startFrameTime)
              return performance.now() / 1000.0 - startFrameTime
            });
            animationFrameId = window.requestAnimationFrame(updateFrameTime);
          };

          if (startFrameTime != -1) {
            animationFrameId = window.requestAnimationFrame(updateFrameTime);
          }

          return () => {
            window.cancelAnimationFrame(animationFrameId);
          };
        }, [startFrameTime]);

        if (startFrameTime === -1) {
          frameTime = 0.5; // don't change
        }

        let notes = <div>
              <RendaNote length={50} centerx="66px" />
              <BalloonNote centerx="539px" />
              <DonNote centerx="176px" />
              <DonNote centerx="220px" />
              <KaNote centerx="264px"  />
              <BigKaNote centerx="341px" />
              <BigDonNote centerx="385px" />
              <Barline centerx="429px" />
            </div>;
          let barlines = <div>
            <Barline centerx="66px" />
            <Barline centerx="110px" />
          </div>;
        // console.log(tja);
        // console.log(frameTime)
        if (tja !== null) {
          // let targetCourse = "EDIT";
          let courses = Object.keys(tja.courses);
          let targetCourse = "EASY";
          if (courses.includes("EDIT")) {
            targetCourse = "EDIT";
          } else if (courses.includes("ONI")) {
            targetCourse = "ONI";
          } else if (courses.includes("HARD")) {
            targetCourse = "HARD";
          } else if (courses.includes("NORMAL")) {
            targetCourse = "NORMAL";
          }
          // console.log(tja)
          // console.log(NoteType.KA);
          // console.log(tja.courses[targetCourse][1])
          console.log(frameTime)
          notes = tja.courses[targetCourse][1].notes.toReversed().map((note, index) => {
            let fractional_position = (note.hitTime - frameTime) * note.speed;
            if (note.type === NoteType.KA || note.type === NoteType.BIG_KA || note.type === NoteType.DON || note.type === NoteType.BIG_DON) {
                if (fractional_position < -2 || fractional_position > 18) {
                return null;
              }
            } else {
              let fractional_position_of_end = note.length * note.speed + fractional_position;
              if ((fractional_position < -2 && fractional_position_of_end < -2) || (fractional_position > 18 && fractional_position_of_end > 18)) {
                return null;
              }
            }

            let centerx = 66 + fractional_position * 44 + "px";
            let centery = "50%";
            if (note.type === NoteType.KA) {
              return <KaNote key={note.id} centerx={centerx} centery={centery} combo={note.combo} />
            } else if (note.type === NoteType.BIG_KA) {
              return <BigKaNote key={note.id} centerx={centerx} centery={centery} combo={note.combo} />
            } else if (note.type === NoteType.DON) {
              return <DonNote key={note.id} centerx={centerx} centery={centery} combo={note.combo} />
            } else if (note.type === NoteType.BIG_DON) {
              return <BigDonNote key={note.id} centerx={centerx} centery={centery} combo={note.combo} />
            } else if (note.type === NoteType.RENDA || note.type === NoteType.BIG_RENDA) {
              console.log(note.length)
              return <RendaNote key={note.id} length={note.length * note.speed * 44} centerx={centerx} centery={centery} />
            } else if (note.type === NoteType.BALLOON) {
              if (frameTime < note.hitTime) {
                centerx = 66 + (note.hitTime - frameTime) * note.speed * 44 + "px";
              } else if (note.hitTime < frameTime && frameTime < note.endTime) {
                centerx = 66 + "px";
              } else {
                centerx = 66 + (note.endTime - frameTime) * note.speed * 44 + "px";
              }
              return <BalloonNote key={note.id} centerx={centerx} centery={centery} />
            }
          });

          barlines = tja.courses[targetCourse][1].barlines.map((barline, index) => {
              let fractional_position = (barline.time - frameTime) * barline.speed;
              let centerx = 66 + fractional_position * 44 + "px";
              let centery = "50%";
              return <Barline key={barline.id} centerx={centerx} centery={centery} />
            });

        }

        // // https://medium.com/projector-hq/writing-a-run-loop-in-javascript-react-9605f74174b
        React.useEffect(() => {
          
        });
        
        return <div className="playfield">
          <div className="judge-ring-center">
            <div className="judge-ring-big"></div>
            <div className="judge-ring-small"></div>
          </div>
            {notes}
            {barlines}
          </div>  
      }

      const container = document.getElementById('root');
      const root = ReactDOM.createRoot(container);
      root.render(<TaikoApp />);

    </script>
